import React from "react";
import defaultAvatar from "../../../../component/Layout/assets/avatar-user.png";
import { Avatar } from "@mui/material";
export default function ChatBoxMessageOwnerUser(props) {
  const { message, avatarSrc } = props;
  const avatarStyles = {
    m: 1,
    border: 2,
    borderColor: "#808080",
  };
  return (
    <>
      <div className="ChatBoxMessageOwnerUser">
        <Avatar src={avatarSrc || defaultAvatar} />
        <div className="ChatBoxMessageContent">
          <div className="ChatBoxMessageInfo">
            <h4 className="ChatBoxMessageInfoName">Tôi</h4>
            <h5 className="ChatBoxMessageInfoTime">11:34 24/12/2021</h5>
          </div>
          <div className="ChatBoxMessageContentText">
            Google Dịch là một công cụ dịch thuật trực tuyến do Google phát
            triển. Nó cung cấp giao diện trang web, ứng dụng trên thiết bị di
            động cho hệ điều hành Android và iOS và giao diện lập trình ứng dụng
            giúp nhà phát triển xây dựng tiện ích mở rộng trình duyệt web và ứng
            dụng phần mềm. Wikipedia
          </div>
        </div>
      </div>
    </>
  );
}
